// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @dev Contract module which sets up the Bonanza Testers Club
 */

contract BonanzaTestersClub is ERC721, Ownable {

    uint256 public tokenCounter;
    uint256 public bonanzaMintPrice;
    uint256 public maxCards;
    uint256 public maxMintPerAddress;
    uint256 public mintedCards;
    uint256 public currentSupply;
    uint256 public publicStart;
    uint256 public whiteListStart;
    string public URI;
    address creator;
    bool public saleIsActive;
    mapping(address => uint256) public addressToMintCount;
    mapping(address => bool) public whitelistedAddress;

    /**
     * @dev build ERC721 token
     */
    constructor (uint256 _maxItems, string memory _URI) public ERC721 ('Bonanza Testers Club on Rinkeby', 'BTCR') {
        maxCards = _maxItems;
        maxMintPerAddress = 2;
        saleIsActive = false;
        mintedCards = 0;
        currentSupply = 0;
        creator = msg.sender;
        URI = _URI;
    }

    /**
     * @dev Allows the owner of the contract to withdraw contract ETH value
     */
    function withdraw() public onlyOwner {
        uint balance = address(this).balance;
        payable(creator).transfer(balance);
    }

    /**
     * @dev sets base price for Bonanza cards
     */
    function setBasePrice(uint256 _price) public onlyOwner {
        bonanzaMintPrice = _price;
    }

    /**
     * @dev sets base price for Bonanza cards
     */
    function setPublicStart(uint256 _start) public onlyOwner {
        publicStart = _start;
    }

    /**
     * @dev sets base price for Bonanza cards
     */
    function setWhiteListStart(uint256 _start) public onlyOwner {
        whiteListStart = _start;
    }

    /**
     * @dev flips state from open to close, and vice versa
     */
    function flipSaleState() public onlyOwner {
        saleIsActive = !saleIsActive;
    }

    /**
     * @dev mints bonanza cards if conditions are respected
     */
    function mintBonanza(uint256 _numberOfTokens) public payable {

        require(saleIsActive, "Sale must be active to mint Bonanza NFTs.");
        require(addressToMintCount[msg.sender] + _numberOfTokens <= maxMintPerAddress, "Purchase would exceed number of tokens you're allowed to mint!");
        require((bonanzaMintPrice * _numberOfTokens) <= msg.value, "Ether value sent is not correct.");
        require((currentSupply + _numberOfTokens) <= maxCards, "Purchase would exceed max amount of tokens that can be minted.");

        if (whitelistedAddress[msg.sender]) {
            require(block.timestamp >= whiteListStart, "Whitelist mint hasn't started yet!");
        } else {
            require(block.timestamp >= publicStart, "Public mint hasn't started yet!");
        }

        for (uint i = 0; i < _numberOfTokens; i++) {
            uint mintIndex = currentSupply;
            _safeMint(msg.sender, mintIndex);
            addressToMintCount[msg.sender] += _numberOfTokens;
            currentSupply += 1;
            mintedCards += 1;
        }

    }

    /**
     * @dev sets an address as whitelisted
     */
    function setWhiteListedAddress(address _address) public onlyOwner {
        whitelistedAddress[_address] = true;
    }

    /**
     * @dev defines which is the base URI to be used for metadata
     */
    function _baseURI() internal view override returns (string memory) {
        return URI;
    }

    /**
     * @dev gives the total supply
     */
    function totalSupply() public view returns (uint256) {
        return maxCards;
    }

    /**
     * @dev gives remaining number of cards that can be minted
     */
    function viewRemainingCards() public view returns (uint256) {
        return maxCards - mintedCards;
    }

}
